import logo from './logo.svg';
import './App.css';
import { Routes, Route, Link } from "react-router-dom";

import Level1 from './Shared/Level1';
import NotFound from './Shared/Errors/NotFound';
import FormBase from './Shared/';

function App() {
    return (
        <main className="App" id="main" class="sectionOne">
            <div class="container-fluid">
                <div class="row">
                    <div class="col-md-8">

                        <Routes>
                            <Route path="/" element={<Level1 />} />

                            <Route path=":formName" element={<FormLayout page="Description?" />}>
                                <Route exact path="/" element={<PageLayout />} />
                                <Route path=":pageNumber" element={<PageLayout />} />
                            </Route>

                            <Route path="*" element={<NotFound />} />
                        </Routes>

                    </div>

                    <div class="col-md-4">

                    </div>
                </div>
            </div>
        </main>
    );
}

export default App;
